import React, { useState, useEffect} from 'react'
import { useParams } from 'react-router-dom';

const Producto = () => {

    const [cardsProducts, setCardsProducts] = useState([])
    const { ID } = useParams();

    useEffect(() => {
        
        fetch('https://res.cloudinary.com/dsdicaf5h/raw/upload/v1676644291/cenicero/productos_vjfpuo.json')
        .then(response => {
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            return response.json();
        })
        .then(dataJson => setCardsProducts(dataJson.results))
        .catch(error => console.log('Error fetching data: ', error));
    }, []);

    const ProductoFiltrado = [];

    for (let i = 0; i < cardsProducts.length; i++) {

        if (cardsProducts[i].id === ID) {
        ProductoFiltrado.push(cardsProducts[i]);
        }
    }

    console.log(ProductoFiltrado)
    return (
        <div>

        </div>
    )
}

export default Producto
